template <typename UnionPtrType> ObliviousHttpCompletionResultPtr ObliviousHttpCompletionResult::Clone() const
{
    switch (tag_) {
    case Tag::kNetError:
        return NewNetError(mojo::Clone(data_.net_error));
    case Tag::kOuterResponseErrorCode:
        return NewOuterResponseErrorCode(mojo::Clone(data_.outer_response_error_code));
    case Tag::kInnerResponse:
        return NewInnerResponse(mojo::Clone(*data_.inner_response));
    }
    return nullptr;
}

template <typename T, typename std::enable_if<std::is_same<T, ObliviousHttpCompletionResult>::value>::type*>
bool ObliviousHttpCompletionResult::Equals(const T& other) const
{
    if (tag_ != other.which())
        return false;

    switch (tag_) {
    case Tag::kNetError:
        return mojo::Equals(data_.net_error, other.data_.net_error);
    case Tag::kOuterResponseErrorCode:
        return mojo::Equals(data_.outer_response_error_code, other.data_.outer_response_error_code);
    case Tag::kInnerResponse:
        return mojo::Equals(*(data_.inner_response), *(other.data_.inner_response));
    }

    return false;
}
